import React from "react";
import styled from "styled-components";
const Card = ({ data, deleteCard }) => {
  console.log(data);
  const { item, calorie } = data;
  //   console.log(item, Cals);
  // const handleClick =
  return (
    <StyledCard>
      <h1>{item}</h1>
      <h3>you have consumed {calorie} cals today</h3>
      <Buttons>
        <button
          onClick={() => {
            deleteCard(item);
          }}
        >
          Remove
        </button>

        <button>Edit</button>
      </Buttons>
    </StyledCard>
  );
};

export default Card;

const StyledCard = styled.div`
  border: 2px solid #33f;
  padding: 20px;
`;

const Buttons = styled.div`
  padding: 10px;
  button {
    margin: 10px;
  }
`;
